import "./right.css";
import EyeIcon from "../Image/eyeIcon.png";
import Alert from "./alert.js";
import datas from "./statics.json";
export default class Event extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
            
	   };
    }
	
    render() {
		const tableInit = this.state.datas.map((item, index) => {
            return (
                <tr className="commandGroupList">
                    <td className="td">{datas.selectedTypeValue}</td>
                    <td className="td">{selectedLevelValue}</td>
                    <td className="td">{selectedStatusValue}</td>
					<td className="td" >{selectedNameValue}</td>
                </tr>
            )
        });
        return (
           <div className="memberList">
				<div className="expertsName">应急事件列表</div>
                <table className="table">
                    <thead>
                        <tr className="tableTitle">
                            <th>应急事件名称</th>
                            <th className="td">类型</th>
                            <th className="td">等级</th>
							<th className="td">状态</th>
							<th className="td">查看</th>
                        </tr>
                    </thead>
                    <tbody >
                        {tableInit}
                    </tbody>
                </table>
            </div>
        )
    }
}
